import './App.css';
import ExpenseItem from './components/Expense/ExpenseItem';

function App() {

    const Expenses = [
        {ItemDate: '28th March 2021', Title: 'Item 1', Price: '19.4'},
        {ItemDate: '28th March 2021', Title: 'Item 1', Price: '19.4'},
        {ItemDate: '28th March 2021', Title: 'Item 1', Price: '19.4'}
    ];

    return (
        <div>
            <ExpenseItem 
                ItemDate = {Expenses[0].ItemDate}
                Title = {Expenses[0].Title}
                Price = {Expenses[0].Price}
            />
            <ExpenseItem 
                ItemDate = {Expenses[0].ItemDate}
                Title = {Expenses[0].Title}
                Price = {Expenses[0].Price}
            />
            <ExpenseItem 
                ItemDate = {Expenses[0].ItemDate}
                Title = {Expenses[0].Title}
                Price = {Expenses[0].Price}
            />
        </div>
    );
}

export default App;
